The function `fib(n)` returns the `n`-th number in the Fibonacci sequence.

If `n` is less than or equal to 0, the function returns 0. If `n` is 1, the function returns 1. For any other value of `n`, the function recursively calls itself to compute the `(n-1)`-th and `(n-2)`-th Fibonacci numbers, and returns their sum.

Here is a Python implementation of the function:

```python
def fib(n):
    if n <= 0:
        return 0
    elif n == 1:
        return 1
    else:
        return fib(n-1) + fib(n-2)
```

